    <header>
        <nav>
            <Button home={true} onClick={() => console.log("clicked")}>
                <Menu/>
            </Button>
            <h1>Bxemployeers</h1>
            {/*
                <div>buscador</div>
                < div > button < /div>
                <div>button</div>
                <div>avatar</div>
            */}
            <Searcher/>
        </nav>
    </header>
);
